        public static List<DTevent> getDemoData(DateTime endTime, string LineName)
        {
            var tmpList = new List<DTevent>();
            DTevent tmpEvent;
            DateTime tmpStartTime;
            DateTime tmpEndTime;
            double tmpDT;
            double tmpUT = 0;
            var r = new Random();
            var random = new Random();
            tmpStartTime = endTime.AddDays(-180);
            tmpDT = random.NextDouble() * 60;
            tmpEndTime = tmpStartTime.AddMinutes(tmpDT);

            //create a single downtime event w/ random characteristics
            tmpEvent = new DTevent(tmpStartTime, tmpEndTime, tmpDT, tmpUT);

            tmpEvent.Reason1 = "1 " + R1s[r.Next(0, R1s.Length - 1)];
            tmpEvent.Reason2 = "2 " + R2s[r.Next(0, R2s.Length - 1)];
            tmpEvent.Reason3 = "3 " + R3s[r.Next(0, R3s.Length - 1)];
            tmpEvent.Reason4 = "4 " + R4s[r.Next(0, R4s.Length - 1)];
            tmpEvent.Fault = Faults[r.Next(0, Faults.Length - 1)];

            tmpEvent.OEE_inout = "PR In";
            tmpEvent.DTGroup = Globals.BLANK_INDICATOR;
            tmpEvent.Location = Globals.BLANK_INDICATOR;
            tmpEvent.Product = Globals.BLANK_INDICATOR;
            tmpEvent.ProductGroup = Globals.BLANK_INDICATOR;
            tmpEvent.ProductCode = Globals.BLANK_INDICATOR;
            tmpEvent.Team = Globals.BLANK_INDICATOR;
            tmpEvent.Tier1 = tmpEvent.Reason1;
            tmpEvent.Tier2 = tmpEvent.Reason2;
            tmpEvent.Tier3 = tmpEvent.Reason3;

            if (tmpEvent.Reason1.Contains("Data") || tmpEvent.Reason1.Contains("Maintenance") || tmpEvent.Reason1.Contains("Meetings") || tmpEvent.Reason1.Contains("Changeover"))
            { tmpEvent.PlannedUnplanned = "Planned"; tmpEvent.isUnplanned = false; tmpEvent.isPlanned = true; }
            else { tmpEvent.PlannedUnplanned = "Unplanned"; tmpEvent.isUnplanned = true; }

            tmpEvent.MappedField = tmpEvent.Tier1;

            tmpEvent.ParentLineName = LineName;

            tmpList.Add(tmpEvent);

            //add the rest of the events
            tmpUT = random.NextDouble() * 90; 
            tmpStartTime = tmpEndTime.AddMinutes(tmpUT);
            tmpDT = random.NextDouble() * 60; 
            tmpEndTime = tmpStartTime.AddMinutes(tmpDT);
            while (tmpEndTime < endTime)
            {
                tmpEvent = new DTevent(tmpStartTime, tmpEndTime, tmpDT, tmpUT);
                tmpEvent.Reason1 = R1s[r.Next(0, R1s.Length - 1)];
                tmpEvent.Reason2 =  R2s[r.Next(0, R2s.Length - 1)];
                tmpEvent.Reason3 = R3s[r.Next(0, R3s.Length - 1)];
                tmpEvent.Reason4 = R4s[r.Next(0, R4s.Length - 1)];

              //  tmpEvent.Reason1 = "1 " + R1s[r.Next(0, R1s.Length - 1)];
